                    return line.assembly ? mainLanesHeight + lanesInterval : getExpandedLanesHeight() + chrLabelsOffsetY;
                })
                .attr('fill', '#300000');
        
            //misassemblies breakpoints lines
            linesLabelsLayer.selectAll('.dashed_lines').remove();
        
            lines = itemLines.selectAll('.g')
                .data(visibleBreakpointLines, function (line) {
                    return line.id;
                })
                .enter().append('g')
                .attr('class', 'dashed_lines')
                .attr('transform', function (line) {
                    return 'translate(' + x_main(line.pos) + ', ' + line.y + ')';
                });
            lines.append('path')
                .attr('d', 'M0,0V' + mainLanesHeight)
                .attr('stroke', function(line) {
                    if (line.type == 'fake') return '#000000';
                    else return '#8A0808';
                })
                .attr('stroke-width', '1');
        
            //update features
            removeTooltip();
            if (!featuresMainHidden) drawFeaturesMain(minExtent, maxExtent);
        
            // update the block rects
            visPaths = [];
            visRects = [];
            visGenesRects = [];
            for (var item_n = 0; item_n < visItems.length; item_n++) {
                visRects.push(visItems[item_n]);
                if (visItems[item_n].triangles) {
                    for (var i = 0; i < visItems[item_n].triangles.length; i++) {
                        var triangle = visItems[item_n].triangles[i];
                        if ((triangle.misassembledEnds == "R" && triangle.corr_end > maxExtent) ||
                            (triangle.misassembledEnds == "L" && triangle.corr_start < minExtent))
                            continue;
                        var w = getItemWidth(triangle, minExtent, maxExtent);
                        var triangle_width = Math.sqrt(0.5) * mainLanesHeight / 2;
                        if (w > triangle_width * 1.5) visPaths.push(triangle);
                    }
                }
                if (visItems[item_n].genes && visItems[item_n].contig_type != "short_contigs") {
                    for (var i = 0; i < visItems[item_n].genes.length; i++) {
                        var gene = visItems[item_n].genes[i];
                        if (gene.corr_start >= maxExtent || gene.corr_end <= minExtent)
                            continue;
                        var visibleLength = getItemWidth(gene, minExtent, maxExtent);
                        if (visibleLength > 0) visGenesRects.push(gene);
                    }
                }
            }
        
            var newItems = createItems(visRects, 'rect', minExtent, maxExtent, '.block');
            createItems(visPaths, 'path', minExtent, maxExtent, '.block');
            createItems(visGenesRects, 'rect', minExtent, maxExtent, '.gene.predicted_gene');
        
            newItems.on('click', function (block) {
                    selected_id = block.groupId;
                    changeInfo(block);
                })
                .on('mouseenter', glow)
                .on('mouseleave', disglow);
        
            addLabels(visRects, minExtent, maxExtent);
            // upd coverage
            if (drawCoverage && (!coverageMainHidden || !physicalCoverageHidden))
                updateMainCoverage(minExtent, maxExtent);
        }
        
        function createItems(visData, itemFigure, minExtent, maxExtent, class_) {
            var oldItems = itemsContainer.selectAll(itemFigure + class_)
                .data(visData, function (block) {
                    return block.id;
                })
                .attr('transform', function (block) {
                    return getTranslate(block, selected_id, minExtent);
                })
                .attr('width', function (block) {
                    return getItemWidth(block, minExtent, maxExtent);
                })
                .attr('height', function (block) {
                    return getItemHeight(block);
                })
                .attr('stroke-opacity', function (block) {
                    return getItemStrokeOpacity(block, selected_id);
                })
                .attr('stroke-width', function (block) {
                    return getItemStrokeWidth(block, selected_id);
                })
                .attr('fill-opacity', function (block) {
                    return getItemOpacity(block);
                })
                .attr('d', function(block) {
                    if (block.misassembledEnds) return make_triangle(block);
                });
            oldItems.exit().remove();
        
            function make_triangle(block) {
                var isSelected = block.groupId == selected_id;
                var startX = isSelected ? (block.misassembledEnds == "L" ? 0.5 : -0.5) : 0;
                var startY = isSelected ? 1.5 : 0;
                if (block.misassembledEnds == "L")
                    path = ['M', startX, startY, 'L', startX + (0.5 * (mainLanesHeight - startY) / 2),
                        (startY + (mainLanesHeight - startY)) / 2, 'L', startX, mainLanesHeight - startY, 'L',  startX, startY].join(' ');
                if (block.misassembledEnds == "R")
                    path = ['M', startX, startY, 'L', startX - (0.5 * (mainLanesHeight - startY) / 2),
                        (startY + (mainLanesHeight - startY)) / 2, 'L', startX, mainLanesHeight - startY, 'L',  startX, startY].join(' ');
                return path;
            }
        
            var newItems = oldItems.enter().append(itemFigure)
                .attr('class', function (block) {
                    if (block.misassembledEnds) {
                        if (!block.objClass) block.objClass = 'misassembled';
                        return 'block end ' + block.objClass;
                    }
                    if (!block.marks || block.contig_type)
                        return 'block mainItem ' + block.objClass;
                    else return 'block';
                })// Define the gradient
                .attr('fill', function (block) {
                    if (block.marks && !block.contig_type)
                        return addGradient(block, block.marks, true);
                })
                .attr('transform', function (block) {
                    return getTranslate(block, selected_id, minExtent);
                })
                .attr('width', function (block) {
                    return getItemWidth(block, minExtent, maxExtent);
                })
                .attr('height', function (block) {
                    return getItemHeight(block);
                })
                .attr('stroke', 'black')
                .attr('stroke-opacity', function (block) {
                    return getItemStrokeOpacity(block, selected_id);
                })
                .attr('stroke-width', function (block) {
                    return getItemStrokeWidth(block, selected_id);
                })
                .attr('fill-opacity', function (block) {
                    return getItemOpacity(block);
                })
                .attr('pointer-events', function (block) {
                    return (block.misassembledEnds || block.notActive) ? 'none' : 'painted';
                })
                .attr('d', function(block) {
                    if (block.misassembledEnds) return make_triangle(block);
                });
            return newItems;
        }
        
        function addLabels(visRects, minExtent, maxExtent) {
            var visibleLinesLabels = separatedLines.filter(function (line) {
                if (line.name && line.corr_start < maxExtent && line.corr_end > minExtent) return line;
                if (line.label) {
                    var textSize = line.label.length * letterSize / 2;
                    if (line.label && line.corr_end - textSize > minExtent && line.corr_end + textSize < maxExtent) return line;
                }
            });
            var prevX = 0;
            var prevLane = -1;
            var visTexts = visRects.filter(function (block) {
                if (!block.name) return;
                var textStart = getItemStart(block, minExtent);
                if (textStart - prevX > 20 || block.lane != prevLane) {
                    var visWidth = getItemEnd(block, maxExtent) - textStart;
                    if (visWidth > 20) {
                        textLen = block.name.length * letterSize;
                        prevX = textStart + Math.min(textLen, visWidth) - 30;
                        prevLane = block.lane;
                        if (block.marks) {
                            visibleLinesLabels.push({label: block.marks, lane: block.lane, corr_start: block.corr_start})
                        }
                        return block;
                    }
                }
            });
        
            function checkItemSize(textItem) {
                return !textItem.size || textItem.size > minContigSize;
            }
        
            function getItemY(textItem) {
                var y = getYForExpandedLanes(textItem);
                //if (INTERLACE_BLOCKS_VERT_OFFSET) y += offsetsY[textItem.order % 3] * lanesInterval;
                return y + 20;
            }
        
            var texts = textLayer.selectAll('text')
                .data(visTexts, function (textItem) {
                    return textItem.id;
                })
                .attr('x', function(textItem) {
                    return getItemStart(textItem, minExtent) + 5;
                })
                .attr('y', function(textItem) {
                    return getItemY(textItem)
                })
                .text(function(textItem) {
                    if (checkItemSize(textItem))
                        return getText(textItem, minExtent, maxExtent);
                });
            texts.exit().remove();
        
            var newTexts = texts.enter().append('text')
                .attr('class', 'itemLabel')
                .attr('x', function(textItem) {
                    return getItemStart(textItem, minExtent) + 5;
                })
                .attr('y', function(textItem) {
                    return getItemY(textItem)
                })
                .attr('pointer-events', 'none')
                .text(function(textItem) {
                    if (checkItemSize(textItem))
                        return getText(textItem, minExtent, maxExtent);
                });
            if (isContigSizePlot)
                getNumberOfContigs(d3.transform(d3.select('#countLine').attr("transform")).translate[0]);
        
            linesLabelsLayer.selectAll('.main_labels').remove();
        
            var visibleItemLabels = itemLabels.selectAll('.g')
                .data(visibleLinesLabels, function (labelItem) {
                    return labelItem.id;
                });
        
            var labelOffset = Math.max(0, extraOffsetY - 3) + 8;
            var labels = visibleItemLabels.enter().append('g')
                .attr('class', 'main_labels')
                .attr('transform', function (labelItem) {
                    var x = getItemStart(labelItem, minExtent) + 5;
                    if (labelItem.lane != null) {
                        y = y_main(labelItem.lane) + mainLanesHeight;
                    }
                    else y = getExpandedLanesHeight() + chrLabelsOffsetY;
                    y += labelOffset;
        
                    return 'translate(' + x + ', ' + y + ')';
                });
            labels.append('rect')
                .attr('class', 'main_labels')
                .attr('height', 15)
                .attr('transform', 'translate(0, -12)');
        
            var labelsText = labels.append('text')
                .text(function (labelItem) {
                    return getText(labelItem, minExtent, maxExtent);
                })
                .attr('text-anchor', 'start');
            if (isContigSizePlot)
                labelsText.attr('class', 'lineLabelText');
            else labelsText.attr('class', 'itemText');
        }
        
        function updateMainCoverage(minExtent, maxExtent) {
            if (!minExtent)
                minExtent = Math.max(brush.extent()[0], x_mini.domain()[0]);
            if (!maxExtent)
                maxExtent = Math.min(brush.extent()[1], x_mini.domain()[1]);
            if (!physicalCoverageHidden)
                drawCoverageLine(minExtent, maxExtent, true, physical_coverage_data, '.phys_covered');
            if (!coverageMainHidden) {
                drawCoverageLine(minExtent, maxExtent, true, coverage_data, '.covered');
                drawCoverageLine(minExtent, maxExtent, true, gc_data, '.gc');
            }
            //main_cov.select('.y').call(y_cov_main_A);
        }
        
        function getNextCovValue(covData, startIdx, endIdx, maxValue, xScale, yScale, minExtent, maxExtent, startPos, plotFactor) {
            var coverage = covData[chromosome].slice(startIdx, endIdx);
            var covDots = coverage.length;
            if (covDots == 0) return;
            var coverageSum = coverage.reduce(function(pv, cv) { return pv + cv; }, 0);
            var avgCoverage = coverageSum / covDots;
            var yValue = Math.min(avgCoverage, maxValue);
        
            if (startIdx == startPos) start = minExtent;
            else start = startIdx * plotFactor;
            end = Math.min(endIdx * plotFactor, maxExtent);
            if (avgCoverage < 1) yValue = 0.1;
            return [xScale(start), yScale(yValue), xScale(end)];
        }
        
        function drawCoverageLine(minExtent, maxExtent, useMainCov, covData, plotClass) {
            var line = '',
                isGC = plotClass == '.gc',
                plotFactor = isGC ? gcFactor : coverageFactor,
                l = (maxExtent - minExtent) / plotFactor,
                cov_main_dots_amount = Math.min(maxCovDots, l),
                step = Math.round(l / cov_main_dots_amount);
        
            if (useMainCov) {
                track = main_cov;
                xScale = x_main;
                yScale = y_cov_main_S;
                maxValue = totalMaxYMain;
            }
            else {
                track = mini_cov;
                xScale = x_mini;
                yScale = y_cov_mini_S;
                maxValue = totalMaxYMini;
            }
            if (isGC) {
                maxValue = 100;
                yScale = d3.scale.linear().domain([maxValue, .1]).range([0, coverageHeight]);
            }
        
            var cov_lines = [];
            var startPos = Math.floor(minExtent / plotFactor / step) * step;
            var nextPos;
            var lastPos = maxExtent / plotFactor;
            for (var i = startPos; i < lastPos; i += step) {
                nextPos = i + step;
                cov_line = getNextCovValue(covData, i, nextPos, maxValue, xScale, yScale, minExtent, maxExtent, startPos, plotFactor);
                if (!cov_line) break;
                cov_lines.push(cov_line);
            }
            if (nextPos < lastPos) {
                cov_line = getNextCovValue(covData, nextPos, lastPos, maxValue, xScale, yScale, minExtent, maxExtent, startPos, plotFactor);
                cov_lines.push(cov_line);
            }
        
            var cov_line;
            var startY = isGC ? cov_lines[0][1] : yScale(0.1);
            line += ['M', cov_lines[0][0], startY].join(' ');
            for (i = 0; i < cov_lines.length; i++) {
                cov_line = cov_lines[i];
                if (cov_line) line += 'V' + ' ' + cov_line[1] + 'H' + ' ' + cov_line[2];
            }
            if (!isGC) line += ['V', yScale(0.1), 'Z'].join(' ');
            track.select(plotClass).select('path').attr('d', line);
        }
        
        function drawFeaturesMain(minExtent, maxExtent) {
            var featuresItems = featurePaths.filter(function (block) {
                if (block.corr_start < maxExtent && block.corr_end > minExtent) {
                    var drawLimit = 0;
                    var visibleLength = getItemWidth(block, minExtent, maxExtent);
                    if (visibleLength > drawLimit)
                        return block;
                }
            });
            var featureRects = featurePath.selectAll('g')
                .data(featuresItems, function (block) {
                    return block.id;
                })
                .attr('transform', function (block) {
                    var x = getItemStart(block, minExtent);
                    var y = y_anno(block.lane) + .15 * featureHeight;
                    //if (INTERLACE_BLOCKS_VERT_OFFSET) y += offsetsMiniY[block.order % 2] * featureHeight;
                    return 'translate(' + x + ', ' + y + ')';
                });
        
            featureRects.select('.R')
                .attr('width', function (block) {
                    return getItemWidth(block, minExtent, maxExtent);
                })
                .attr('height', featureHeight);
            featureRects.exit().remove();
            featurePath.selectAll('text')
                .remove();
        
            var otherFeatures = featureRects.enter().append('g')
                .attr('class', function (block) {
                    return block.objClass;
                })
                .attr('transform', function (block) {
                    var x = getItemStart(block, minExtent);
                    var y = y_anno(block.lane) + .15 * featureHeight;
                    // if (INTERLACE_BLOCKS_VERT_OFFSET) y += offsetsMiniY[block.order % 2] * featureHeight;
        
                    return 'translate(' + x + ', ' + y + ')';
                });
        
            otherFeatures.append('rect')
                .attr('class', 'R')
                .attr('width', function (block) {
                    return getItemWidth(block, minExtent, maxExtent);
                })
                .attr('height', featureHeight)
                .on('mouseenter', selectFeature)
                .on('mouseleave', deselectFeature)
                .on('click',  function(block) {
                    addTooltip(block);
                });
            var visFeatureTexts = featuresItems.filter(function (block) {
                if (getItemWidth(block, minExtent, maxExtent) > 45) return block;
            });
            featurePath.selectAll('text')
                .data(visFeatureTexts, function (textItem) {
                    return textItem.id;
                })
                .enter().append('text')
                .attr('fill', 'white')
                .attr('class', 'featureLabel')
                .style("font-size", "10px")
                .attr('x', function(textItem) {
                    return getItemStart(textItem, minExtent) + 2;
                })
                .attr('y', function(textItem) {
                    var y = y_anno(textItem.lane) + .15 * featureHeight;
                    if (INTERLACE_BLOCKS_VERT_OFFSET) y += offsetsMiniY[textItem.order % 2] * featureHeight;
                    return y + featureHeight / 2;
                })
                .text(function(textItem) {
                    var w = getItemWidth(textItem, minExtent, maxExtent);
                    return getVisibleText(textItem.name ? textItem.name : 'ID=' + textItem.id, w - 10);
                });
        }
        
        function setupXAxis() {
            var mainTickValue;
            xMainAxis = d3.svg.axis()
                .scale(x_main)
                .orient('bottom')
                .tickSize(6, 0, 0);
            addMainXAxis(main, mainHeight + chrLabelsOffsetY);
            var miniTickValue = getTickValue(x_mini.domain()[1]);
        
            xMiniAxis = appendXAxis(mini, x_mini, miniHeight, miniTickValue);
        
            mini.append('g')
                .attr('transform', 'translate(0,' + miniHeight + ')')
                .attr('class', 'axis')
                .call(xMiniAxis);
        
            if (!featuresHidden) {
                addMiniXAxis(annotationsMini, x_mini, annotationsMiniHeight, miniTickValue);
                addMainXAxis(annotationsMain, annotationsHeight);
            }
            if (drawCoverage) {
                addMiniXAxis(mini_cov, x_mini, coverageHeight, miniTickValue);
                addMainXAxis(main_cov, coverageHeight);
            }
        }
        
        function addMiniXAxis(track, scale, height, tickValue) {
            var axis = appendXAxis(track, scale, height, tickValue);
            track.append('g')
                .attr('transform', 'translate(0,' + height + ')')
                .attr('class', 'axis')
                .call(axis);
        }
        
        function addMainXAxis(track, trackHeight) {
            track.append('g')
                .attr('transform', 'translate(0,' + trackHeight + ')')
                .attr('class', 'main axis')
                .call(xMainAxis);
        }
        
        function appendXAxis(lane, scale, laneHeight, tickValue) {
            var ticksValues = scale.ticks(5);
            ticksValues = [scale.domain()[0]].concat(ticksValues);
            ticksValues.push(scale.domain()[1]);
        
            var min_ticks_delta = Math.max(getTextSize(formatValue(ticksValues.slice(-1)[0], tickValue).toString(), numberSize),
                getTextSize(formatValue(ticksValues.slice(-2)[0], tickValue).toString(), numberSize));
            if (scale(ticksValues.slice(-1)[0]) - scale(ticksValues.slice(-2)[0]) < min_ticks_delta) {
                ticksValues.splice(-2, 1)
            }
        
            var xAxis = d3.svg.axis()
                .scale(scale)
                .orient('bottom')
                .tickSize(6, 0, 0)
                .tickValues(ticksValues)
                .tickFormat(function(value) {
                    return formatValue(value, tickValue);
                });
            if (!tickValue) return xAxis;
        
            lane.append('g')
                .attr('transform', 'translate(0,' + laneHeight + ')')
                .attr('class', 'axis')
                .call(xAxis).append('text')
                .attr('transform', 'translate(' + scale(scale.domain()[1]) + ',' + (laneHeight / 2 + 2) + ')');
            var lastTick = lane.select(".axis").selectAll("g")[0].pop();
            var lastTickValue = ticksValues.pop();
            d3.select(lastTick).select('text').text(formatValue(lastTickValue, tickValue) + ' ' + tickValue)
                .attr('transform', 'translate(-10, 0)');
            return xAxis;
        }
        
        function mainAxisUpdate() {
            var startPos = x_main.domain()[0];
            var endPos = x_main.domain()[1];
            var domain = endPos - startPos;
            mainTickValue = getTickValue(domain);
        
            xMainAxis.tickFormat(function(tickValue) {
                var pos = startPos + tickValue * domain;
                var currentLen = 0;
                if (!isContigSizePlot && chrContigs.length > 1) { // correct coordinates for chromosomes
                    for (var i = 0; i < chrContigs.length; i++) {
                        chrName = chrContigs[i];
                        chrLen = chromosomes_len[chrName];
                        if (currentLen + chrLen >= pos) {
                            pos -= currentLen;
                            break;
                        }
                        if (pos == 0)
                            pos = 1;
                        currentLen += chrLen;
                    }
                }
                return formatValue(pos, mainTickValue);
            });
            updateTrack(main);
            if (!featuresMainHidden) updateTrack(annotationsMain);
            if (!coverageMainHidden) updateTrack(main_cov);
        }
        
        function updateTrack(track) {
            track.select('.main.axis').call(xMainAxis);
            var lastTick = track.select(".axis").selectAll("g")[0].pop();
            var textSize = Math.max(0, (formatValue(x_main.domain()[1], mainTickValue).toString().length - 2) * numberSize);
            d3.select(lastTick).select('text').text(lastTick.textContent + ' ' + mainTickValue)
                .attr('transform', 'translate(-' + textSize + ', 0)');
        }
        
        function hideTrack(track, pane, doHide) {
            removeTooltip();
            var animationDuration = 200, transitionDelay = 150;
            var paneToHide, hideBtn, textToShow, newOffset;
            var changedTracks = [], changedBtns = [];
            var mainPane = (pane == 'main');
        
            function setBtnTopPos(btn) {
                if (!btn) return;
                btn.style.transition = 'all 0.2s';
                btn.style.top = parseInt(btn.style.top) + newOffset + 'px';
            }
        
            function setTrackPos(track) {
                if (!track) return;
                var trackY = d3.transform(track.attr("transform")).translate[1];
                trackY += newOffset;
                track.transition()
                    .duration(animationDuration)
                    .attr('transform', function(d) {
                        return 'translate(' + margin.left + ',' + trackY + ')'
                    });
            }
        
            if (track == 'features') {
                textToShow = 'Show annotation';
                paneToHide = mainPane ? annotationsMain : annotationsMini;
                hideBtn = mainPane ? hideBtnAnnotationsMain : hideBtnAnnotationsMini;
                newOffset = mainPane ? annotationsHeight : annotationsMiniHeight;
                if (mainPane) {
                    featuresMainHidden = doHide;
                    changedTracks = [main_cov, mini, annotationsMini, mini_cov];
                    changedBtns = [hideBtnCoverageMain, hideBtnPhysicalCoverageMain, hideBtnGCMain, covMainControls,
                        hideBtnAnnotationsMini, hideBtnCoverageMini, hideBtnPhysicalCoverageMini, hideBtnGCMini, covMiniControls];
                }
                else {
                    changedTracks = [mini_cov];
                    changedBtns = [hideBtnCoverageMini, hideBtnPhysicalCoverageMini, hideBtnGCMini, covMiniControls];
                }
            }
            else if (track == 'cov') {
                textToShow = 'Show read coverage and GC distribution';
                paneToHide = mainPane ? main_cov : mini_cov;
                hideBtn = mainPane ? hideBtnCoverageMain : hideBtnCoverageMini;
                hidePhysicalCovBtn = mainPane ? hideBtnPhysicalCoverageMain : hideBtnPhysicalCoverageMini;
                hideGCBtn = mainPane ? hideBtnGCMain : hideBtnGCMini;
                coverageBtns = mainPane ? covMainControls : covMiniControls;
                newOffset = coverageHeight;
                if (mainPane) {
                    coverageMainHidden = doHide;
                    changedTracks = [mini, annotationsMini, mini_cov];
                    changedBtns = [hideBtnAnnotationsMini, hideBtnCoverageMini, hideBtnPhysicalCoverageMini, hideBtnGCMini, covMiniControls];
                }
                if (doHide) {
                    hidePhysicalCovBtn.style.display = 'none';
                    hideGCBtn.style.display = 'none';
                    coverageBtns.style.display = 'none';
                }
                else {
                    hidePhysicalCovBtn.style.display = '';
                    hideGCBtn.style.display = '';
                    coverageBtns.style.display = '';
                }
            }
            if (doHide) newOffset *= -1;
            if (!doHide) textToShow = 'Hide';
            for (var track_n = 0; track_n < changedTracks.length; track_n++)
                setTrackPos(changedTracks[track_n])
            for (var btn_n = 0; btn_n < changedBtns.length; btn_n++)
                setBtnTopPos(changedBtns[btn_n])
            if (doHide) paneToHide.attr('display', 'none');
            else paneToHide.transition().delay(transitionDelay).attr('display', '');
            hideBtn.onclick = function() {
                hideTrack(track, pane, !doHide);
            };
            hideBtn.innerHTML = textToShow;
            display();
        }
        
        function sync(syncBrush, track) {
            var minExtent = Math.max(syncBrush.extent()[0], x_mini.domain()[0]),
                maxExtent = Math.min(syncBrush.extent()[1], x_mini.domain()[1]);
            if (minExtent + minBrushExtent >= x_mini.domain()[1]) minExtent = maxExtent - minBrushExtent;
            if (maxExtent - minExtent < minBrushExtent) maxExtent = minExtent + minBrushExtent;
            brush.extent([minExtent, maxExtent]);
            if (brush_cov && track != 'coverage') brush_cov.extent([minExtent, maxExtent]);
            if (brush_anno && track != 'features') brush_anno.extent([minExtent, maxExtent]);
            display();
        }
        
        function drawBrush(track, height, trackName) {
            var offsetY = 7;
            track.append('rect')
                .attr('pointer-events', 'painted')
                .attr('width', chartWidth)

                    itemId++;
                    numItems++;
                    var structure = getBlockStructure(block);
                    if (block.genes) {
                        genePrediction = true;
                        var corr_start = block.corr_start;
                        if (block.contig_type != 'ambiguous' && structure && structure.length > 0)
                            corr_start =  structure[0].corr_start;
                        for (var gene_n = 0; gene_n < block.genes.length; gene_n++) {
                            if (!block.genes[gene_n].corr_start) {
                                block.genes[gene_n].corr_start = Math.max(block.genes[gene_n].start + corr_start, block.corr_start);
                                block.genes[gene_n].corr_end = Math.min(block.genes[gene_n].end + corr_start, block.corr_end);
                            }
                            block.genes[gene_n].groupId = block.groupId;
                            block.genes[gene_n].lane = block.lane;
                            block.genes[gene_n].nonOverlappingLane = block.nonOverlappingLane;
                            block.genes[gene_n].objClass = 'gene predicted_gene';
                            block.genes[gene_n].notActive = true;
                        }
                    }
                    if (block.mis_ends && misassembled_ends) {
                        for (var num = 0; num < misassembled_ends.length; num++) {
                            if (!misassembled_ends[num]) continue;
                            var triangleItem = {};
                            triangleItem.name = block.name;
                            triangleItem.corr_start = block.corr_start;
                            triangleItem.corr_end = block.corr_end;
                            triangleItem.assembly = block.assembly;
                            triangleItem.id = itemId;
                            triangleItem.lane = laneId;
                            triangleItem.nonOverlappingLane = block.nonOverlappingLane;
                            triangleItem.groupId = groupId;
                            triangleItem.misassembledEnds = misassembled_ends[num];
                            triangleItem.misassemblies = block.misassemblies.split(';')[num];
                            block.triangles.push(triangleItem);
                            itemId++;
                            numItems++;
                        }
                    }
                    return block
                }
        
                for (var assemblyName in chart.assemblies) {
                    var lane = chart.assemblies[assemblyName];
                    var currentLen = 0;
                    var numItems = 0;
                    var lastPosInLanes = [];
                    var lastBlockSizesInLanes = [];
                    var laneItems = [];
                    for (var i = 0; i < lane.length; i++) {
                        var block = lane[i];
                        if (block.mis_ends) var misassembled_ends = block.mis_ends.split(';');
                        if (isContigSizePlot) {
                            var blocks = getBlockStructure(block);
                            if (blocks) {
                                for (var k = 0; k < blocks.length; k++) {
                                    var misassembly = (k < blocks.length - 1 && blocks[k + 1].contig_type == 'M') ? blocks[k + 1] : null;
                                    if (blocks[k].contig_type != 'M' && block.contig_type != 'ambiguous')
                                        laneItems.push(parseItem(blocks[k], block, misassembly));
                                    if (block.contig_type == 'ambiguous') {
                                        blocks[k].start_in_ref = blocks[k].corr_start;
                                        blocks[k].end_in_ref = blocks[k].corr_end;
                                    }
                                }
                            }
                        }
                        var newItem = parseItem(block);
                        if (!block.is_best) {
                            newItem.best_group = getBlockStructure(block);
                            newItem.structure = null;
                        }
                        laneItems.push(newItem);
                        groupId++;
                    }
                    for (var i = 0; i < laneItems.length; i++) {
                        item = laneItems[i];
                        if (!isContigSizePlot) {
                            item.nonOverlappingLane = lastPosInLanes.length - item.nonOverlappingLane - 1;
                            if (item.triangles) {
                                for (var j = 0; j < item.triangles.length; j++) {
                                    item.triangles[j].nonOverlappingLane = lastPosInLanes.length - item.triangles[j].nonOverlappingLane - 1;
                                }
                            }
                            if (item.genes) {
                                for (var j = 0; j < item.genes.length; j++) {
                                    item.genes[j].nonOverlappingLane = lastPosInLanes.length - item.genes[j].nonOverlappingLane - 1;
                                }
                            }
                        }
                        items.push(item);
                    }
        
                    lanes.push({
                        id: laneId,
                        label: assemblyName,
                        maxLines: lastPosInLanes.length,
                        isExpanded: false,
                    });
                    laneId++;
                }
        
                addAssemblyDescription(lanes);
                return {lanes: lanes, items: items};
            }
        
            function setupCoverage() {
                numYTicks = 5;
                // draw mini coverage
                x_cov_mini_S = x_mini,      // x coverage scale
                y_max = typeof reads_max_depth !== 'undefined' ? Math.max(reads_max_depth[chromosome], physical_max_depth[chromosome]) :
                    max_depth[chromosome];
        
                y_cov_mini_S = setYScaleCoverage();
                y_cov_main_S = y_cov_mini_S;
        
                y_gc_scale = d3.scale.linear().domain([100, .1]).range([0, coverageHeight]);
                y_gc_ticks = [20, 40, 60, 80, 100];
                y_gc_axis = d3.svg.axis()
                    .orient('right')
                    .tickFormat(function(val, i) {
                        return i < y_gc_ticks.length - 1 ? val + '%' : "GC";
                    })
                    .tickSize(2, 0)
                    .tickValues(y_gc_ticks);
                y_gc_axis.scale(y_gc_scale);
                mini_cov = chart.append('g')
                    .attr('class', 'coverage')
                    .attr('transform', 'translate(' + margin.left + ', ' + covMiniOffsetY + ')');
                mini_cov.append('g')
                    .attr('class', 'y cov')
                    .style("fill", "steelblue");
                mini_cov.append('g')
                    .attr('class', 'y gc_plot')
                    .style("fill", "#3d6f15")
                    .attr('transform', 'translate(' + width + ', 0)');
                mini_cov.select('.y.gc_plot').call(y_gc_axis);
        
                function calculateTicks(scale) {
                    var maxValue = scale.domain()[0];
                    var covTicks = d3.scale.linear().domain(scale.domain()).ticks(4);
                    var tickStep = covTicks[1] - covTicks[0];
                    covTicks = covTicks.filter(function (x) {
                        return x < maxValue - tickStep / 2;
                    });
                    covTicks.push(maxValue);
                    return covTicks;
                }
                // draw main coverage
                y_cov_mini_A = d3.svg.axis()
                    .orient('left')
                    .tickFormat(function(val, i, n) {
                        return val < y_cov_mini_S.domain()[0] ? val + 'x' : "Cov";
                    })
                    .tickSize(2, 0)
                    .tickValues(function () {
                        return calculateTicks(y_cov_mini_S);
                    });
        
                y_cov_main_A = d3.svg.axis()
                    .orient('left')
                    .tickFormat(function(val, i, n) {
                        return val < y_cov_main_S.domain()[0] ? val + 'x' : "Cov";
                    })
                    .tickSize(2, 0)
                    .tickValues(function () {
                        return calculateTicks(y_cov_main_S);
                    });
        
                var x_cov_main_A = xMainAxis;
                main_cov = chart.append('g')
                    .attr('class', 'COV')
                    .attr('transform', 'translate(' + margin.left + ', ' + covMainOffsetY + ')');
        
                main_cov.attr('display', 'none');
                main_cov.append('g')
                    .attr('class', 'y gc_plot')
                    .style("fill", "#3d6f15")
                    .attr('transform', 'translate(' + width + ', 0)');
                main_cov.select('.y.gc_plot').call(y_gc_axis);
                main_cov.append('g')
                    .attr('class', 'y cov')
                    .style("fill", "steelblue");
        
                setYScaleLabels(mini_cov, y_cov_mini_A, y_cov_mini_S);
                setYScaleLabels(main_cov, y_cov_main_A, y_cov_main_S);
                appendPaths(mini_cov);
                appendPaths(main_cov);
                totalMaxYMini = y_max;
                totalMaxYMain = y_max;
                if (typeof physical_coverage_data !== 'undefined') {
                    drawCoverageLine(x_mini.domain()[0], x_mini.domain()[1], false, physical_coverage_data, '.phys_covered');
                    togglePhysCoverageMini();
                }
                drawCoverageLine(x_mini.domain()[0], x_mini.domain()[1], false, coverage_data, '.covered');
                drawCoverageLine(x_mini.domain()[0], x_mini.domain()[1], false, gc_data, '.gc');
            }
        
            function appendPaths(track) {
                track.append('g')
                    .attr('class', 'phys_covered')
                    .append('path');
                track.append('g')
                    .attr('class', 'covered')
                    .append('path');
                track.append('g')
                    .attr('class', 'gc')
                    .append('path');
            }
        
            // generates a single path for each block class in the mini display
            // ugly - but draws mini 2x faster than append lines or line generator
            // is there a better way to do a bunch of lines as a single path with d3?
            function getMiniItems(items) {
                var result = [];
                var curLane = 0;
                var numItem = 0;
        
                var countSupplementary = 0;
                for (var c, i = 0; i < items.length; i++) {
                    block = items[i];
                    if (block.lane != curLane) {
                        numItem = 0;
                        countSupplementary = 0;
                    }
                    result.push(createMiniItem(block, curLane, numItem, countSupplementary));
                    curLane = block.lane;
                    if (!block.notActive) numItem++;
                    if (block.triangles && block.triangles.length > 0)
                        for (var j = 0; j < block.triangles.length; j++) {
                            result.push(createMiniItem(block.triangles[j], curLane, numItem, countSupplementary));
                            numItem++;
                            countSupplementary++;
                        }
                }
                return result;
            }
        
            function createMiniItem(block, curLane, numItem, countSupplementary) {
                var miniPathHeight = 10;
                var isSmall = x_mini(block.corr_end) - x_mini(block.corr_start) < miniPathHeight;
        
                block.misassembled = block.misassemblies ? "True" : "False";
                c = (block.misassembled == "False" ? "" : "misassembled");
                c += (block.similar && block.similar == "True" ? " similar" : "");
                if (block.more_unaligned && block.misassembled == "True") {
                    c = "mis_unaligned";
                    block.misassemblies = "";
                }
                else if (block.more_unaligned) {
                    c = "correct_unaligned";
                }
                if (block.ambiguous) c = "ambiguous";
                if (!block.is_best && block.ambiguous_alignments && block.ambiguous_alignments.length > 0) c = "alternative";
                //c += ((!block.misassembledEnds && !isSmall) ? " light_color" : "");
                if (INTERLACE_BLOCKS_COLOR) c += ((numItem - countSupplementary) % 2 == 0 ? " odd" : "");
                var text = '';
                if (isContigSizePlot) {
                    if (block.contig_type == "short_contigs") c += " disabled";
                    else if (block.contig_type == "correct") c += "";
                    else if (!block.contig_type) c += " unknown";
                    else c += " " + block.contig_type;
                }
        
                if (block.marks) {  // NX for contig size plot
                  var marks = block.marks;
                  text = marks;
                  marks = marks.split(', ');
                  for (var m = 0; m < marks.length; m++)
                    c += " " + marks[m].toLowerCase();
                }
        
                block.objClass = c;
                block.order = numItem - countSupplementary;
        
                var startX = block.misassembledEnds == "R" ? x_mini(block.corr_end) : x_mini(block.corr_start);
                var endX = x_mini(block.corr_end);
                var pathEnd = x_mini(block.corr_end);
                var startY = y_mini(block.lane) + .18 * miniLanesHeight;
                if (INTERLACE_BLOCKS_VERT_OFFSET) startY += offsetsMiniY[items[i].order % 3] * miniLanesHeight;
                var path = '';
                if (!isSmall) {
                    if (block.misassembledEnds == "L") path = ['M', startX, startY, 'L', startX + (Math.sqrt(3) * miniPathHeight / 2), startY + miniPathHeight / 2,
                      'L', startX, startY + miniPathHeight, 'L',  startX, startY].join(' ');
                    else if (block.misassembledEnds == "R") path = ['M', startX, startY, 'L', startX - (Math.sqrt(3) * miniPathHeight / 2), startY + miniPathHeight / 2,
                      'L', startX, startY + miniPathHeight, 'L',  startX, startY].join(' ');
                }
                return {objClass: block.objClass, path: path, misassemblies: block.misassemblies, misassembledEnds: block.misassembledEnds,
                    start: startX, end: endX, y: startY, size: block.size, text: text, id: block.id, contig_type: block.contig_type, fullContig: block.fullContig};
            }
        
            function parseFeaturesData(chr) {
              var lanes = [];
              var features = [];
              var data = [];
              var laneId = 0, itemId = 0;
        
              for (var numContainer = 0; numContainer < features_data.length; numContainer++) {
                  var lane = features_data[numContainer];
                  var numItems = 0;
                  var chrIndex = 0;
                  for (var i = 0; i < lane.length; i++) {
                      chrIndex = typeof references_by_id !== 'undefined' ? chrContigs.indexOf(references_by_id[lane[i].chr]) : lane[i].chr;
                      if (!oneHtml && chrIndex == -1) continue;
                      var block = lane[i];
                      block.lane = laneId;
                      block.id = itemId;
                      block.chr = chrIndex;
                      block.corr_start = block.corr_start ? block.corr_start : block.start;
                      block.corr_end = block.corr_end ? block.corr_end : block.end;
                      features.push(block);
                      itemId++;
                      numItems++;
                  }
                  if (numItems > 0) {
                      lanes.push({
                          id: laneId,
                          label: lane[0].kind });
                      laneId++;
                  }
              }
              return {lanes: lanes, features: features}
            }
        
            function addFeatureTrackItems(annotations, scale) {
                var annotationsItems = annotations.append('g').selectAll('miniItems')
                    .data(featurePaths)
                    .enter().append('rect')
                    .attr('class', function (d) {
                      return d.objClass;
                    })
                    .attr('transform', function (d) {
                      return 'translate(' + d.x + ', ' + d.y + ')';
                    })
                    .attr('width', function (d) {
                      return scale(d.corr_end - d.corr_start);
                    })
                    .attr('height', featureMiniHeight)
                    .on('mouseenter', selectFeature)
                    .on('mouseleave', deselectFeature)
                    .on('click',  function(d) {
                        addTooltip(d);
                    });
                var visFeatureTexts = featurePaths.filter(function (d) {
                        if (scale(d.corr_end) - scale(d.corr_start) > 45) return d;
                });
                annotations.append('g').selectAll('miniItems')
                                    .data(visFeatureTexts)
                                    .enter().append('text')
                                    .style("font-size", "10px")
                                    .text(function (d) {
                                        var textContent = d.name ? d.name : 'ID=' + d.id;
                                        var textItemLen = scale(d.corr_end) - scale(d.corr_start);
                                        return getVisibleText(textContent, textItemLen)
                                    })
                                    .attr('class', 'featureLabel')
                                    .attr('transform', function (d) {
                                      return 'translate(' + (d.x + 3) + ', ' + (d.y + featureMiniHeight / 2 + 3) + ')';
                                    });
            }
        
            function addFeatureTrackInfo (annotations, scale) {
                annotations.append('g').selectAll('.laneLines')
                    .data(featuresData.lanes)
                    //.enter().append('line')
                    .attr('x1', 0)
                    .attr('y1', function (d) {
                        return d3.round(scale(d.id)) + .5;
                    })
                    .attr('x2', chartWidth)
                    .attr('y2', function (d) {
                        return d3.round(scale(d.id)) + .5;
                    })
                    .attr('stroke', function (d) {
                        return d.label === '' ? 'white' : 'lightgray'
                    });
        
                annotations.append('g').selectAll('.laneText')
                    .data(featuresData.lanes)
                    .enter().append('text')
                    .text(function (d) {
                        return d.label;
                    })
                    .attr('x', -10)
                    .attr('y', function (d) {
                        return scale(d.id + .5);
                    })
                    .attr('dy', '.5ex')
                    .attr('text-anchor', 'end')
                    .attr('class', 'laneText');
            }
        
            function getFeaturePaths(features) {
                var d, result = [];
                var curLane = 0;
                var numItem = 0;
        
                for (var c, i = 0; i < features.length; i++) {
                    d = features[i];
                    if (d.lane != curLane) numItem = 0;
                    c = "gene ";
                    if (INTERLACE_BLOCKS_COLOR) c += (numItem % 2 == 0 ? "odd" : "");
        
                    features[i].objClass = c;
        
                    var x = x_mini(d.corr_start);
                    var y = y_anno_mini(d.lane);
                    y += .15 * annotationMiniLanesHeight;
                    if (d.objClass.search("odd") != -1)
                        y += .04 * annotationMiniLanesHeight;
        
                    result.push({objClass: c, name: d.name, start: d.start, end: d.end, corr_start: d.corr_start, corr_end: d.corr_end,
                        id: d.id_, y: y, x: x, lane: d.lane, order: i});
                    curLane = d.lane;
                    numItem++;
                }
                return result;
            }
        
            function drawChartLanes() {
                // draw the lanes for the main chart
                main.append('g').selectAll('.laneLines')
                    .data(lanes)
                    //.enter().append('line')
                    .attr('x1', 0)
                    .attr('y1', function (d) {
                        return d3.round(y_main(d.id)) + .5;
                    })
                    .attr('x2', chartWidth)
                    .attr('y2', function (d) {
                        return d3.round(y_main(d.id)) + .5;
                    })
                    .attr('stroke', function (d) {
                        return d.label === '' ? 'white' : 'lightgray'
                    });
        
                var laneLabelOffsetX = 80 + (isContigSizePlot ? 20 : 0);
                addLanesText(main, y_main, lanes, laneLabelOffsetX, true, !isContigSizePlot);
                if (!isContigSizePlot)
                    addExpandBtns();
        
                // draw the lanes for the mini chart
                laneLabelOffsetX = 100;
                mini.append('g').selectAll('.laneLines')
                    .data(lanes)
                    //.enter().append('line')
                    .attr('x1', 0)
                    .attr('y1', function (lane) {
                        return d3.round(y_mini(lane.id)) + .5;
                    })
                    .attr('x2', chartWidth)
                    .attr('y2', function (lane) {
                        return d3.round(y_mini(lane.id)) + .5;
                    })
                    .attr('stroke', function (lane) {
                        return lane.label === '' ? 'white' : 'lightgray'
                    });
                addLanesText(mini, y_mini, lanes, laneLabelOffsetX, false, false);
            }
        
            function addLanesText(track, scale, lanes, laneLabelOffsetX, isMain, addStdoutLink) {
                track.selectAll('.laneText').remove();
                track.selectAll('.laneText')
                        .data(lanes)
                        .enter().append('text')
                        .attr('x', -10)
                        .attr('y', function (lane) {
                            var y = getExpandedLanesCount(lane.id);
                            return scale(y + (isMain ? .1 :.5));
                        })
                        .attr('dy', '.5ex')
                        .attr('text-anchor', 'end')
                        .attr('class', 'laneText')
                        .text(function(lane) { return isMain ? lane.description : lane.label; })
                        .call(wrap, laneLabelOffsetX, true, addStdoutLink, -10, /\n/);
            }
        
            function addLanesBackgrounds() {
                main.selectAll('.lane_bg')
                        .data(lanes)
                        .enter().append('rect')
                        .attr('x', 0)
                        .attr('y', function (lane) {
                            return y_main(lane.id) - 1;
                        })
                        .attr('width', chartWidth)
                        .attr('height', mainLanesHeight + 10)
                        .attr('display', 'none')
                        .attr('class', 'lane_bg');
            }
        
            function addExpandBtns() {
                var expandableLanes = [];
                for (var lanes_n = 0; lanes_n < lanes.length; lanes_n++) {
                    lane = lanes[lanes_n];
                    if (lane.maxLines > 1)
                        expandableLanes.push(lane);
                }
                d3.select('body').selectAll('.expandBtn')
                        .data(expandableLanes)
                        .enter().append('div')
                        .style('display', 'none')
                        .style('position', 'absolute')
                        .style('left', (margin.left + chartWidth + 5) + 'px')
                        .style('width', '10px')
                        .style('height', '15px')
                        .attr('class', 'expandBtn collapsedBtn btn btn-mini btn-inverse')
                        .attr('data-toggle', 'tooltip')
                        .attr('title', 'Expand overlapping blocks')
                        .html('+')
                        .on('click', function (lane) {
                            var isCollapsed = $(this).attr('class').search("collapsed") != -1;
                            //$(this).attr('collapsed', function(_, attr){ return !attr});
                            if (isCollapsed)
                                $(this).html('&minus;');
                            else $(this).html('&plus;');
                            expandLane(lane.id, isCollapsed);
                            d3.select(this).classed('collapsedBtn', !isCollapsed);
                        })
                        .on('hover', function (lane) {
                            var isCollapsed = $(this).attr('class').search("collapsed") != -1;
                            //$(this).attr('collapsed', function(_, attr){ return !attr});
                            if (isCollapsed)
                                $(this).html('&minus;');
                            else $(this).html('&plus;');
                            expandLane(lane.id, isCollapsed);
                            d3.select(this).classed('collapsedBtn', !isCollapsed);
                        });
            }
        
            function moveExpandBtns() {
                d3.select('body').selectAll('.expandBtn')
                                 .style('top', function (lane) {
                                    var y = getExpandedLanesCount(lane.id);
                                    return (y_main(y) + mainOffsetY + 3) + 'px';
                                 })
                                 .style('display', '');
            }
    </script>
